import React from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import "./App.css";
import Form from "./components/Form";
import Table from "./components/Table";

function App() {
  const navigate = useNavigate();

  const handleEdit = (id) => {
    navigate(`/form/${id}`);
  };

  const handleFormClose = () => {
    navigate("/");
  };

  return (
    <Routes>
      <Route
        path="/"
        element={<Table onEdit={handleEdit} />}
      />
      <Route
        path="/form/:id"
        element={<Form onClose={handleFormClose} />}
      />
    </Routes>
  );
}

export default App;
